t point with antigen presenting cell.","The process whose specific outcome is the progression of the embryo in the uterus over time, from formation of the zygote in the oviduct, to birth. An example of this process is found in Mus musculus.","Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of an organonitrogen stimulus. An organonitrogen compound is formally a compound containing at least one carbon-nitrogen bond.","The process in which a relatively unspecialized cell acquires specialized features of an adipocyte, an animal connective tissue cell specialized for the synthesis and storage of fat.","The chemical reactions and pathways involving glycogen, a polydisperse, highly branched glucan composed of chains of D-glucose residues in alpha-(1->4) glycosidic linkage, joined together by alpha-(1->6) glycosidic linkages.","The process whose specific outcome is the progression of the kidney over time, from its formation to the mature structure. The kidney is an organ that filters the blood and/or excretes the end products of body metabolism in the form of urine.","Any process that stops, prevents, or reduces the rate of production of a cytokine.","The hatching of the cellular blastocyst from the zona pellucida.","NA","NA","The process in which the anatomical structures of a nephron tubule are generated and organized. A nephron tubule is an epithelial tube that is part of the nephron, the functional part of the kidney.","Any process that decreases the rate, frequency or extent of the progression of the cell over time, from its formation to the mature structure. Cell development does not include the steps involved in committing a cell to a specific fate.","The process in which the anatomical structures of the trabecular cardiac ventricle muscle are generated and organized.","The process in which the cardiac atrium is generated and organized. A cardiac atrium receives blood from a vein and pumps it to a cardiac ventricle.","The differentiation of endothelial cells from progenitor cells during blood vessel development, and the de novo formation of blood vessels and tubes.","The chemical reactions and pathways resulting in the formation of acetyl-CoA from pyruvate in the mitochondrion. The process begins with the transport of pyruvate from the cytosol to the mitochondrion where it is subsequently decarboxylated to form acetyl-CoA.","Any process that increases the rate, frequency or extent of pathway-restricted SMAD protein phosphorylation. Pathway-restricted SMAD proteins and common-partner SMAD proteins are involved in the transforming growth factor beta receptor signaling pathways.","The selective autohagy process in which parts of the endoplasmic reticulum are loaded into autophagosomes, delivered to the vacuole, and degraded in response to changing cellular conditions.","NA","Any process that modulates the levels of hormone within an organism or a tissue. A hormone is any substance formed in very small amounts in one specialized organ or group of cells and carried (sometimes in the bloodstream) to another organ or group of cells in the same organism, upon which it has a specific regulatory action.","The release of intracellular molecules (e.g. hormones, matrix proteins) contained within a membrane-bounded vesicle by fusion of the vesicle with the plasma membrane of a cell, induced by a rise in cytosolic calcium-ion levels.","Any process that activates, maintains or increases the rate of a response to an external stimulus.","The directed movement of an organic hydroxy compound (organic alcohol) into, out of or within a cell, or between cells, by means of some agent such as a transporter or pore. An organic hydroxy compound is an organic compound having at least one hydroxy group attached to a carbon atom.","Any process in which a secretory granule is transported to, and/or maintained in, a specific location within the cell.","Any process that activates or increases the frequency, rate or extent of the Notch signaling pathway.","Any intracellular signal transduction in which the signal is passed on within the cell via cyclic AMP (cAMP). Includes production of cAMP, and downstream effectors that further transmit the signal within the cell.","Any process that modulates the frequency or rate of macrophage activation.","The directed movement of some substance from outside of a cell, across the plasma membrane and into the cytosol.","NA","The assembly of actin filament bundles; actin filaments are on the same axis but may be oriented with the same or opposite polarities and may be packed with different levels of tightness.","The process in which a relatively unspecialized myeloid precursor cell acquires the specialized features of any cell of the myeloid leukocyte, megakaryocyte, thrombocyte, or erythrocyte lineages.","Any process that activates or increases the frequency, rate or extent of the controlled release of a substance from a cell or a tissue.","Any process that modulates the frequency, rate or extent of epithelial cell migration.","A receptor-mediated endocytosis process that results in the internalization of a neurotransmitter receptor from the postsynaptic membrane endocytic zone into an endocytic vesicle.","Any process that stops, prevents, or reduces the frequency, rate or extent of cell differentiation.","Any process that stops, prevents, or reduces the frequency, rate or extent of phagocytosis.","Any process that activates or increases the frequency, rate or extent of phagocytosis.","Any process that results in a change in state or activity of a cell or an organism (in terms of movement, secretion, enzyme production, gene expression, etc.) as a result of an insulin stimulus. Insulin is a polypeptide hormone produced by the islets of Langerhans of the pancreas in mammals, and by the homologous organs of other organisms.","The directed movement of metal ions, any metal ion with an electric charge, into, out of or within a cell, or between cells, by means of some agent such as a transporter or pore.","NA","The series of events in which an external biotic stimulus is detected and converted into a molecular signal.  An external biotic stimulus is defined as one caused or produced by a living organism other than the one being stimulated.","Any process that activates or increases the rate or extent of endothelial cell proliferation.","The process in which a cell in an organism interprets its surroundings.","A process in which an inorganic cation is transported from one side of a membrane to the other by means of some agent such as a transporter or pore.","Any process that decreases the frequency, rate or extent of cell migration involved in sprouting angiogenesis. Cell migration involved in sprouting angiogenesis is the orderly movement of endothelial cells into the extracellular matrix in order to form new blood vessels contributing to the process of sprouting angiogenesis.","The directed movement of some substance from outside of a cell into a cell. This may occur via transport across the plasma membrane or via endocytosis.","Any process that activates or increases the frequency, rate or extent of adipocyte differentiation.","Any process that stops, prevents, or reduces the frequency, rate or extent of synaptic transmission, the process of communication from a neuron to a target (neuron, muscle, or secretory cell) across a synapse.","Any process in which a protein is maintained in a specific location within, or in the membrane of, a cell, and is prevented from moving elsewhere.","Any process that increases the rate, frequency or extent of protein maturation by peptide bond cleavage.","Any process that modulates the frequency, rate or extent of tumor necrosis factor production.","Any process that decreases the rate, frequency or extent of neuron projection development. Neuron projection development is the process whose specific outcome is the progression of a neuron projection over time, from its formation to the mature structure. A neuron projection is any process extending from a neural cell, such as axons or dendrites (collectively called neurites).","Any process that activates or increases the frequency, rate or extent of hydrolase activity, the catalysis of the hydrolysis of various bonds.","The appearance of a macrophage cytokine due to biosynthesis or secretion following a cellular stimulus, resulting in an increase in its intracellular or extracellular levels.","Any process that stops, prevents, or reduces the frequency, rate, extent or direction of cell growth.","NA","Any process that modulates the extent of heart contraction, changing the force with which blood is propelled.","The chemical reactions and pathways involving oxaloacetate, the anion of oxobutanedioic acid, an important intermediate in metabolism, especially as a component of the TCA cycle.","The formation of an apical junction, a functional unit located near the cell apex at the points of contact between epithelial cells composed of the tight junction, the zonula adherens junction and the desmosomes, by the aggregation, arrangement and bonding together of its constituents.","A process that is carried out at the cellular level which results in the assembly, arrangement of constituent parts, or disassembly of an extracellular matrix.","The process in which a vitamin is transported across a membrane. A vitamin is one of a number of unrelated organic substances that occur in many foods in small amounts and that are necessary in trace amounts for the normal metabolic functioning of the body.","Any process that modulates the frequency, rate or extent of protein complex assembly.","Any process that decreases the frequency, rate or extent of the directed movement of proteins within cells.","NA","NA","The chemical reactions and pathways resulting in the formation of carbohydrates, any of a group of organic compounds based of the general formula Cx(H2O)y, carried out by individual cells.","Any process that modulates the frequency, rate or extent of the formation, arrangement of constituent parts, or disassembly of cytoskeletal structures comprising actin filaments and their associated proteins.","The process whose specific outcome is the progression of a cartilage element over time, from its formation to the mature structure. Cartilage elements are skeletal elements that consist of connective tissue dominated by extracellular matrix containing collagen type II and large amounts of proteoglycan, particularly chondroitin sulfate.","Any process that stops, prevents, or reduces the frequency, rate or extent of an organismal process, the processes pertinent to the function of an organism above the cellular level; includes the integrated processes of tissues and organs.","The chemical reactions and pathways involving medium-chain fatty acids, any fatty acid with a chain length of between C6 and C12.","A process that is carried out at the cellular level which results in the assembly, arrangement of constituent parts, or disassembly of cytoskeletal structures containing both actin and myosin or paramyosin. The myosin may be organized into filaments.","A process in which a protein is transported to, or maintained in, a specific location in the plasma membrane.","Any process that modulates the frequency, rate or extent of the directed movement of a motile cell or organism in response to a specific chemical concentration gradient.","The directed movement of lipids into, out of or within a cell, or between cells, by means of some agent such as a transporter or pore. Lipids are compounds soluble in an organic solvent but not, or sparingly, in an aqueous solvent.","Any process involved in the maintenance of an internal steady state of calcium ions at the level of a cell.","Coordinated organization of groups of cells in the plane of an epithelium that contributes to the closure of the neural tube."],[0.
